import React from 'react'
import Todo from './Todo'
function TodoList({ todos }) {
    console.log(todos)
    return (
        <ul>
            {todos.map((todo) => (
                <div key={todo.id}>
                    <Todo todo={todo} />
                </div>
            ))}
        </ul>
    )
}

export default TodoList
